import React, { useEffect, useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  Vibration,
  Platform,
  Alert,
  Image,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Audio } from 'expo-av';
import { Ionicons } from '@expo/vector-icons';

const GuardianAlertReceivedScreen = ({ route }) => {
  const navigation = useNavigation();
  const [sound, setSound] = useState();
  const [isAlertActive, setIsAlertActive] = useState(true);
  const victimName = route.params?.victimName || 'User';
  const location = route.params?.location || 'Location not available';
  const whatsappNumber = route.params?.whatsappNumber || 'Not provided';

  useEffect(() => {
    startAlert();
    return () => {
      stopAlert();
    };
  }, []);

  const startAlert = async () => {
    // Start vibration pattern
    if (Platform.OS === 'android') {
      Vibration.vibrate([1000, 1000], true);
    }

    // Start alarm sound
    try {
      const { sound: alarmSound } = await Audio.Sound.createAsync(
        require('../../assets/sounds/emergency_alarm.mp3'),
        { shouldPlay: true, isLooping: true }
      );
      setSound(alarmSound);
    } catch (error) {
      console.log('Error playing sound:', error);
    }
  };

  const stopAlert = async () => {
    // Stop vibration
    Vibration.cancel();

    // Stop sound
    if (sound) {
      await sound.stopAsync();
      await sound.unloadAsync();
    }
  };

  const handleStopAlert = () => {
    Alert.alert(
      'Confirm Stop Alert',
      'Are you sure you want to stop the alert? Only do this if you have confirmed the victim is safe.',
      [
        {
          text: 'Cancel',
          style: 'cancel',
        },
        {
          text: 'Stop Alert',
          style: 'destructive',
          onPress: () => {
            stopAlert();
            setIsAlertActive(false);
            navigation.goBack();
          },
        },
      ]
    );
  };

  return (
    <View style={styles.container}>
      <View style={styles.alertContainer}>
        <Text style={styles.emergencyText}>EMERGENCY ALERT</Text>
        <Text style={styles.victimName}>From: {victimName}</Text>
        
        <View style={styles.locationContainer}>
          <Text style={styles.locationLabel}>Current Location:</Text>
          <Text style={styles.locationText}>{location}</Text>
        </View>

        <View style={styles.whatsappContainer}>
          <Ionicons name="logo-whatsapp" size={24} color="#25D366" />
          <Text style={styles.whatsappText}>
            Live location has been sent to your WhatsApp: {whatsappNumber}
          </Text>
        </View>

        <TouchableOpacity
          style={styles.stopButton}
          onPress={handleStopAlert}
        >
          <Text style={styles.stopButtonText}>STOP ALERT</Text>
          <Text style={styles.warningText}>
            Click only when you're safe or in contact with the victim
          </Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000',
  },
  alertContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  emergencyText: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#FF0000',
    textAlign: 'center',
    marginBottom: 20,
  },
  victimName: {
    fontSize: 24,
    color: '#FFF',
    marginBottom: 30,
  },
  locationContainer: {
    backgroundColor: 'rgba(255, 0, 0, 0.2)',
    padding: 15,
    borderRadius: 10,
    marginBottom: 30,
    width: '100%',
  },
  locationLabel: {
    color: '#FFF',
    fontSize: 16,
    marginBottom: 5,
  },
  locationText: {
    color: '#FFF',
    fontSize: 18,
    fontWeight: 'bold',
  },
  whatsappContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 40,
  },
  whatsappText: {
    color: '#FFF',
    fontSize: 16,
    marginLeft: 10,
  },
  stopButton: {
    backgroundColor: '#FF0000',
    padding: 15,
    borderRadius: 10,
    width: '100%',
    alignItems: 'center',
  },
  stopButtonText: {
    color: '#FFF',
    fontSize: 20,
    fontWeight: 'bold',
  },
  warningText: {
    color: '#FFF',
    fontSize: 12,
    marginTop: 5,
    textAlign: 'center',
  },
});

export default GuardianAlertReceivedScreen;
